import { ContainerBase } from '../../style';
import { ContainerPage } from './style';

export default function SecondPage() {
 return (
   <ContainerBase>
        <ContainerPage>
                <h2>status code</h2>
            <div>
                <input
                    type='number'
                    placeholder='Digite um status code'
                />
            </div>
        </ContainerPage>
   </ContainerBase>
 );
}
